    public int findContentChildren(int[] g, int[] s) {
        if (g == null || s == null) {
            return 0;
        }
        int gMove = 0;
        int sMove = 0;
        Arrays.sort(g);
        Arrays.sort(s);

        while (gMove < g.length && sMove < s.length) {
            if (g[gMove] <= s[sMove]) {
                gMove++;
            }
            sMove++;
        }

        return gMove;
    }
